import React, { useState, useEffect } from "react";
import { Sun, Moon } from "lucide-react";

export default function Header() {
  const [menuOpen, setMenuOpen] = useState(false);
  const [darkMode, setDarkMode] = useState(
    localStorage.getItem("theme") === "dark"
  );

  // Apply dark mode to HTML root
  useEffect(() => {
    if (darkMode) {
      document.documentElement.classList.add("dark");
      localStorage.setItem("theme", "dark");
    } else {
      document.documentElement.classList.remove("dark");
      localStorage.setItem("theme", "light");
    }
  }, [darkMode]);

  return (
    <header className="fixed top-0 w-full z-50 bg-gray-900/70 dark:bg-gray-100/70 backdrop-blur-md shadow-lg border-b border-gray-800 dark:border-gray-200 transition-all duration-300">
      <div className="container mx-auto px-6 py-4 flex items-center justify-between text-white dark:text-gray-900">
        {/* ===== LOGO ===== */}
        <div className="flex items-center gap-3 cursor-pointer group">
          <div className="w-11 h-11 rounded-xl bg-gradient-to-br from-cyan-400 via-indigo-500 to-purple-600 
          flex items-center justify-center text-white font-extrabold text-lg shadow-md 
          transform transition-transform duration-500 group-hover:rotate-180 group-hover:scale-110">
            N
          </div>
          <div>
            <div className="text-xl font-extrabold tracking-wide">Neotech</div>
            <div className="text-xs text-gray-400 dark:text-gray-600">Software & Cloud</div>
          </div>
        </div>

        {/* ===== NAVIGATION (Desktop) ===== */}
        <nav className="hidden md:flex items-center gap-10 text-sm font-medium">
          <a href="#home" className="relative group">
            Home
            <span className="absolute left-0 -bottom-1 w-0 h-[2px] bg-cyan-400 group-hover:w-full transition-all duration-300"></span>
          </a>
          <a href="#services" className="relative group">
            Services
            <span className="absolute left-0 -bottom-1 w-0 h-[2px] bg-cyan-400 group-hover:w-full transition-all duration-300"></span>
          </a>
          <a href="#about" className="relative group">
            About
            <span className="absolute left-0 -bottom-1 w-0 h-[2px] bg-cyan-400 group-hover:w-full transition-all duration-300"></span>
          </a>
        </nav>

        {/* ===== RIGHT SIDE BUTTONS ===== */}
        <div className="flex items-center gap-4">
          {/* Theme Toggle Button */}
          <button
            onClick={() => setDarkMode(!darkMode)}
            className="p-2 rounded-full bg-gray-800 dark:bg-gray-200 text-white dark:text-gray-900 hover:scale-110 transition-all duration-300 shadow-md"
            title="Toggle Theme"
          >
            {darkMode ? <Sun size={18} /> : <Moon size={18} />}
          </button>

          {/* Contact Button */}
          <a
            href="#contact"
            className="hidden md:inline-block px-5 py-2.5 rounded-full bg-gradient-to-r from-cyan-500 to-indigo-600 
            text-white text-sm font-semibold shadow-md hover:shadow-cyan-500/30 hover:scale-105 transition-all duration-300"
          >
            Contact Us
          </a>

          {/* Mobile Menu Button */}
          <button
            className="md:hidden flex flex-col gap-1.5 focus:outline-none"
            onClick={() => setMenuOpen(!menuOpen)}
          >
            <span
              className={`block w-6 h-0.5 bg-white dark:bg-gray-900 transition-all duration-300 ${
                menuOpen ? "rotate-45 translate-y-2" : ""
              }`}
            ></span>
            <span
              className={`block w-6 h-0.5 bg-white dark:bg-gray-900 transition-all duration-300 ${
                menuOpen ? "opacity-0" : ""
              }`}
            ></span>
            <span
              className={`block w-6 h-0.5 bg-white dark:bg-gray-900 transition-all duration-300 ${
                menuOpen ? "-rotate-45 -translate-y-2" : ""
              }`}
            ></span>
          </button>
        </div>
      </div>

      {/* ===== MOBILE MENU ===== */}
      {menuOpen && (
        <div className="md:hidden bg-gray-900/95 dark:bg-gray-100/95 backdrop-blur-md text-center text-white dark:text-gray-900 border-t border-gray-700 dark:border-gray-200">
          <a href="#home" className="block py-3 border-b border-gray-800 dark:border-gray-200 hover:bg-gray-800 dark:hover:bg-gray-200 transition">
            Home
          </a>
          <a href="#services" className="block py-3 border-b border-gray-800 dark:border-gray-200 hover:bg-gray-800 dark:hover:bg-gray-200 transition">
            Services
          </a>
          <a href="#about" className="block py-3 border-b border-gray-800 dark:border-gray-200 hover:bg-gray-800 dark:hover:bg-gray-200 transition">
            About
          </a>
          <a href="#contact" className="block py-3 text-cyan-400 font-semibold hover:bg-gray-800 dark:hover:bg-gray-200 transition">
            Contact Us
          </a>
        </div>
      )}
    </header>
  );
}
